CREATE TABLE IF NOT EXISTS dex.cex_pools (
    pool_name text,
    pool bytea,
    token_name text,
    decimals integer,
    token bytea,
    PRIMARY KEY (pool, token)
);

BEGIN;
TRUNCATE dex.cex_pools;



COMMIT;

CREATE INDEX IF NOT EXISTS dex_cex_pools_pool_idx ON dex.cex_pools (pool);
CREATE INDEX IF NOT EXISTS dex_cex_pools_pool_name_idx ON dex.cex_pools (pool_name);
CREATE INDEX IF NOT EXISTS dex_cex_pools_token_idx ON dex.cex_pools (token);
CREATE INDEX IF NOT EXISTS dex_cex_pools_token_name_idx ON dex.cex_pools (token_name);
